import GoogleLogin from 'react-google-login'


const Oath = () => {
    responseGoogle=(response)=>{
        console.log(response);
        console.log(response.profile);
    }
    return (
        <div className="oath">
            <GoogleLogin 
                clientId="619358641730-0h0cmc2tcoks4cc2fuhlstgr9sks5no4.apps.googleusercontent.com"
                buttonText=" "
                cookiePolicy="single_host_origin"
            />
            {/* <div draggable="true" className="google">google</div> */}
            <div draggable="true" className="github">github</div>
            <div draggable="true" className="facebook">facebook</div>
        </div>
    )
}

export default Oath
